import React, { useState, useEffect } from 'react';
import GetManufacturersList from '../../../interfaces/BackendCalls';

import SearchBox from '../Common/SearchBox';

function SearchManufacturer(props) {

    var manufacturersList = null;

    useEffect(() => {
        if (props.vehicleType.id) {
            GetManufacturersList(props.vehicleType.id).then((result) => result.length > 0 ? manufacturersList = result : {});
        }
    });

    return (

        <div>
            <SearchBox setOption={props.setManufacturerId} itemsList={manufacturersList} placeholder="Digite a Marca"/>
        </div>
    )

}

export default SearchManufacturer;
